DROP DATABASE if exists crowd_admin;
CREATE DATABASE  crowd_admin;
use crowd_admin;
drop table if exists admin_t;
drop table if exists role_t;

CREATE TABLE `admin_t` (
                           `id` int(11) NOT NULL AUTO_INCREMENT,
                           `login_acct` varchar(255) NOT NULL,
                           `user_pswd` char(100) NOT NULL,
                           `user_name` varchar(255) NOT NULL,
                           `email` varchar(255) NOT NULL,
                           `create_time` char(19) DEFAULT NULL,
                           PRIMARY KEY (`id`),
                           UNIQUE KEY `admin_t_UN` (`login_acct`),
                           UNIQUE KEY `admin_t_UNB` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=10005 DEFAULT CHARSET=utf8mb4;

CREATE TABLE `role_t` (
    `id` INT(11) NOT NULL AUTO_INCREMENT,
    `name` CHAR(100),
     PRIMARY KEY(`id`)
) DEFAULT CHARSET=utf8mb4;

